import React from 'react';

const BoxService = props => {
  const { icon, title, children } = props;
  return (
    <div className='box-service'>
      {/* {icon} */}
      <h4>{title}</h4>
      <p>{children}</p>
    </div>
  );
};

export default BoxService;
